@notice Execute an ETH transfer if a valid ZK proof is provided.
 @param to recipient
 @param amount amount of wei to send
 @param nonce unique nonce used in proof to prevent replay
 @param proof zk-proof bytes
 @param pubSignals public signals expected by the verifier (must match prover)
 Expected `pubSignals` layout (example):
 pubSignals[0] = uint256(uint160(address(this)))      // wallet address
 pubSignals[1] = uint256(uint160(to))                 // recipient
 pubSignals[2] = amount                                // amount in wei
 pubSignals[3] = nonce                                 // nonce
 pubSignals[4] = uint256(ownerCommitment)             // owner commitment encoded as uint256
 IMPORTANT: the prover must pack public inputs in exactly this order/encoding.
